//0x905c13008BF02d663CD058523795b01743aD5c7f
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract AgregatorRate is Ownable {
    AggregatorV3Interface internal priceFeed;

    /**
     * Network: Mumbai Testnet
     * Aggregator: USDT/USD
     * use for matic Address: 0xd0D5e3DB44DE05E9F294BB0a3bEEaF030DE24Ada
     * USDT: 0x92C09849638959196E976289418e5973CC96d645
     */
    string rate;

    constructor(string memory _assetOne, string memory _assetTwo, address _aggregatorAddress) {
        priceFeed = AggregatorV3Interface(
            _aggregatorAddress

        );
        rate = string.concat(_assetOne,"/",_assetTwo);

    }
    // TODO - uint256 everywhere!!!

    /**
     * Returns the latest price
     */

    function changeAggregatorAddress(string memory _assetOne, string memory _assetTwo, address _aggregatorAddress) public onlyOwner{
        priceFeed = AggregatorV3Interface(
            _aggregatorAddress

        );
        rate = string.concat(_assetOne,"/",_assetTwo);
    }

    function getLatestRate() public view returns (int256, uint256, string memory) {
        (,int256 price,,,) = priceFeed.latestRoundData();
        uint256 decimals = priceFeed.decimals();
        return (price,decimals, rate);
    }
}

